import React, { useEffect, useState } from "react";
import Popup from "reactjs-popup";
import "reactjs-popup/dist/index.css";
import { v4 as uuidv4 } from "uuid";
import AppointmentStatusUpdater from "../AppointmentStatusUpdater";
import "./DoctorCard.css";

const highlightText = (text, keyword) => {
  if (!keyword) return text;
  const regex = new RegExp(`(${keyword})`, "gi");
  const parts = text.split(regex);
  return parts.map((part, i) =>
    part.toLowerCase() === keyword.toLowerCase() ? (
      <span key={i} className="bg-warning px-1 fw-bold rounded">
        {part}
      </span>
    ) : (
      part
    )
  );
};

const DoctorCard = ({
  name,
  speciality,
  experience,
  ratings,
  isInstant = false,
  FormComponent,
  highlight = "",
}) => {
  const [showModal, setShowModal] = useState(false);
  const [appointments, setAppointments] = useState([]);
  const storedEmail = sessionStorage.getItem("email");

  useEffect(() => {
    if (!storedEmail) return;

    const type = isInstant ? "instant" : "normal";
    const url = `http://localhost:3001/appointments?doctorName=${encodeURIComponent(
      name
    )}&doctorSpeciality=${encodeURIComponent(
      speciality
    )}&email=${storedEmail}&type=${type}`;

    fetch(url)
      .then((res) => res.json())
      .then((data) => setAppointments(data))
      .catch((err) => console.error("Error fetching appointments:", err));
  }, [name, speciality, storedEmail, isInstant]);

  const handleBooking = (appointmentData) => {
    if (!storedEmail) {
      alert("Please log in to book an appointment.");
      return;
    }

    const {
      name: patientName,
      phoneNumber,
      date,
      selectedSlot,
    } = appointmentData;

    const newAppointment = {
      id: uuidv4(),
      doctorName: name,
      doctorSpeciality: speciality,
      name: patientName,
      phoneNumber,
      email: storedEmail,
      type: isInstant ? "instant" : "normal",
      timeSlot: new Date().toISOString(),
      status: "booked",
    };

    if (!isInstant) {
      newAppointment.date = date;
      newAppointment.selectedSlot = selectedSlot;
    }

    fetch("http://localhost:3001/appointments", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(newAppointment),
    })
      .then((res) => res.json())
      .then(() => {
        setAppointments((prev) => [...prev, newAppointment]);
        alert("Appointment booked successfully!");
        setShowModal(false);
      })
      .catch((err) => console.error("Booking failed:", err));
  };

  const handleCancel = (id) => {
    if (!window.confirm("Are you sure you want to cancel this appointment?"))
      return;

    fetch(`http://localhost:3001/appointments/${id}`, {
      method: "DELETE",
    })
      .then(() => {
        setAppointments((prev) => prev.filter((appt) => appt.id !== id));
        alert("Appointment cancelled successfully!");
      })
      .catch((err) => console.error("Cancellation failed:", err));
  };

  return (
    <div className="card doctor-card shadow-sm h-100 mx-auto text-center">
      <div className="card-body d-flex flex-column justify-content-between">
        <div className="mb-3">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="60"
            height="60"
            fill="currentColor"
            className="bi bi-person-circle text-primary mb-3"
            viewBox="0 0 16 16"
          >
            <path d="M11 10a5 5 0 0 1-6 0C3 10 1 11 1 13v1h14v-1c0-2-2-3-4-3z" />
            <path fillRule="evenodd" d="M8 9a3 3 0 1 0 0-6 3 3 0 0 0 0 6z" />
          </svg>
          <h5 className="card-title">{highlightText(name, highlight)}</h5>
          <h6 className="card-subtitle mb-2 text-muted">
            {highlightText(speciality, highlight)}
          </h6>
          <p className="mb-1">{experience} years experience</p>
          <p className="fw-semibold text-primary">Ratings: {ratings}</p>
        </div>

        <Popup
          trigger={
            <button
              className={`btn w-100 mt-2 ${
                appointments.some((a) => a.status !== "completed")
                  ? "btn-danger text-white"
                  : "btn-primary"
              }`}
              onClick={() => setShowModal(true)}
            >
              {appointments.some((a) => a.status !== "completed")
                ? "Cancel Appointment"
                : "Book Appointment"}
            </button>
          }
          modal
          open={showModal}
          onClose={() => setShowModal(false)}
        >
          <div className="modal-dialog modal-dialog-scrollable modal-lg">
            <div className="modal-content p-4">
              <div className="text-center">
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="50"
                  height="50"
                  fill="currentColor"
                  className="bi bi-person-circle text-secondary mb-2"
                  viewBox="0 0 16 16"
                >
                  <path d="M11 10a5 5 0 0 1-6 0C3 10 1 11 1 13v1h14v-1c0-2-2-3-4-3z" />
                  <path
                    fillRule="evenodd"
                    d="M8 9a3 3 0 1 0 0-6 3 3 0 0 0 0 6z"
                  />
                </svg>
                <h5>{name}</h5>
                <p className="text-muted">{speciality}</p>
                <p>
                  {experience} years experience | Ratings: {ratings}
                </p>
              </div>

              <AppointmentStatusUpdater
                appointments={appointments}
                setAppointments={setAppointments}
              />

              {appointments.some((a) => a.status !== "completed") ? (
                <>
                  <h5 className="mt-4">Appointment Booked</h5>
                  {appointments.map((appt) => {
                    const canCancel = (() => {
                      if (isInstant || !appt.date || !appt.selectedSlot)
                        return true;
                      const [startTimeStr] = appt.selectedSlot.split(" - ");
                      const appointmentDateTime = new Date(
                        `${appt.date} ${startTimeStr}`
                      );
                      const now = new Date();
                      const diffInMinutes =
                        (appointmentDateTime - now) / (1000 * 60);
                      return diffInMinutes >= 60;
                    })();

                    return (
                      <div
                        className="border rounded p-3 my-3 bg-light"
                        key={appt.id}
                      >
                        <p className="mb-1">
                          <strong>Name:</strong> {appt.name}
                        </p>
                        <p className="mb-1">
                          <strong>Phone:</strong> {appt.phoneNumber}
                        </p>
                        <p className="mb-1">
                          <strong>Booked At:</strong>{" "}
                          {new Date(appt.timeSlot).toLocaleString("en-GB", {
                            hour: "2-digit",
                            minute: "2-digit",
                            day: "2-digit",
                            month: "2-digit",
                            year: "numeric",
                          })}
                        </p>
                        {!isInstant && (
                          <>
                            <p className="mb-1">
                              <strong>Date:</strong> {appt.date}
                            </p>
                            <p className="mb-1">
                              <strong>Slot:</strong> {appt.selectedSlot}
                            </p>
                          </>
                        )}
                        {appt.status === "completed" ? (
                          <p className="text-success mt-2">
                            Appointment completed
                          </p>
                        ) : canCancel ? (
                          <button
                            className="btn btn-danger mt-2"
                            onClick={() => handleCancel(appt.id)}
                          >
                            Cancel Appointment
                          </button>
                        ) : (
                          <p className="text-danger mt-2">
                            Cannot cancel: Appointment is within 1 hour.
                          </p>
                        )}
                      </div>
                    );
                  })}
                </>
              ) : (
                <FormComponent isInstant={isInstant} onSubmit={handleBooking} />
              )}
            </div>
          </div>
        </Popup>
      </div>
    </div>
  );
};

export default DoctorCard;
